script: |
  super -f text -I q9136.spq | sort > q9136.out

inputs:
  - name: q9136.spq
    data: |
      SELECT col0 / + 31 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 * - col0 * ( - col1 ) / + 10 * - col0 * col0 IS NULL;
  - name: tab2

outputs:
  - name: q9136.out
    data: |
      1
      2
      2
